func TestBoltzmannMCMC2(t *testing.T) {
	fmt.Println("TestBoltzmannMCMC #2")
	counts := IntMatrix{
		{5, 843, 238, 12, 0, 0, 122, 0, 500, 0, 233, 0, 0, 1825, 44, 1911, 0, 2, 1357, 200},
		{49, 0, 155, 37, 0, 0, 314, 0, 0, 2, 0, 132, 0, 0, 20, 1590, 4, 306, 1195, 0},
		{0, 111, 89, 97, 0, 0, 0, 6000, 0, 20, 0, 0, 0, 3030, 18, 1163, 505, 2813, 583, 0},
		{20, 230, 45, 218, 0, 0, 1, 0, 215, 123, 0, 0, 0, 0, 37, 8, 0, 1603, 157, 0},
		{6, 3, 120, 422, 0, 186, 6, 0, 30, 484, 1, 3, 0, 968, 2, 4, 1307, 56, 23, 0},
		{1, 0, 8, 709, 0, 2289, 18, 0, 35, 0, 7, 17, 0, 294, 0, 209, 32, 0, 1, 4},
		{0, 0, 2, 1034, 0, 0, 35, 0, 271, 21, 32, 74, 0, 59, 0, 91, 0, 0, 0, 180},
		{21, 0, 0, 1306, 0, 830, 48, 0, 759, 2429, 120, 256, 0, 7, 0, 35, 0, 0, 0, 40},
		{0, 0, 0, 7, 19, 0, 47, 0, 778, 1818, 0, 691, 0, 0, 0, 11, 0, 0, 0, 49},
		{0, 0, 0, 1359, 48, 0, 32, 1, 293, 0, 0, 1472, 0, 0, 0, 3, 0, 0, 0, 35},
	}

	// compute similarity matrix Using Kendall's 1971 Theorem I
	sim := Adj2Sim(counts, "rows")

	energyFn := "Psi"
	temp := 300.0
	burnin := 1000
	totalSamples := 5000
	iter := 100
	trials := 2
	improLagMax := 60
	r := 5

	rhoH, rankH, pOH := BoltzmannMCMC(sim, energyFn, temp, burnin, totalSamples, iter)
	_, perm := RobFAntK(sim, trials, improLagMax, r)
	fmt.Println("Rank matrix")
	rankH.WriteGo()
	fmt.Println()
	fmt.Println("Rank matrix rearranged")
	rankH.RearrangeRows(perm)
	rankH.WriteGo()
	fmt.Println()
	fmt.Println("Pair-order matrix")
	pOH.WriteGo()
	fmt.Println()
	fmt.Println("Rho histogram")
	rhoH.Print()
	fmt.Println()
	fmt.Println("----------------------------------------")
	fmt.Println()
}

